import React from 'react';
import { Finding } from '../types';

interface ImagingPanelProps {
  showAI: boolean;
  setShowAI: (val: boolean) => void;
  findings: Finding[];
}

export const ImagingPanel: React.FC<ImagingPanelProps> = ({ showAI, setShowAI, findings }) => {
  const activeFindings = findings.filter(f => f.status !== 'Deleted');

  return (
    <div className="flex flex-col h-full bg-white dark:bg-slate-900 overflow-hidden">
      {/* Panel Header */}
      <div className="px-4 py-3 border-b border-slate-100 dark:border-slate-800 flex items-center justify-between shrink-0">
        <div className="flex items-center gap-2">
          <div className="w-1.5 h-1.5 rounded-full bg-slate-300 dark:bg-slate-600" />
          <span className="text-[11px] font-semibold text-slate-500 dark:text-slate-400 uppercase tracking-widest">Radiographic Imaging</span>
        </div>
        <div className="flex items-center gap-2">
          <span className="text-[11px] text-slate-400">AI Overlay</span>
          <button
            onClick={() => setShowAI(!showAI)}
            className={`relative w-9 h-5 rounded-full transition-colors duration-200 focus:outline-none ${showAI ? 'bg-primary' : 'bg-slate-200 dark:bg-slate-700'}`}
            role="switch"
            aria-checked={showAI}
          >
            <span className={`absolute top-0.5 w-4 h-4 bg-white rounded-full shadow-sm transition-transform duration-200 ${showAI ? 'translate-x-4' : 'translate-x-0.5'}`} />
          </button>
        </div>
      </div>

      {/* Image Container */}
      <div className="flex-1 relative bg-slate-950 overflow-hidden mx-3 my-3 rounded-xl" style={{ minHeight: 0 }}>
        <img
          src="data:image/png;base64,"
          alt="Periapical Radiograph"
          className="w-full h-full object-cover opacity-55 grayscale brightness-110 contrast-125 select-none"
          draggable={false}
        />

        {/* Scan line effect */}
        <div className="absolute inset-0 pointer-events-none" style={{
          background: 'repeating-linear-gradient(0deg, transparent, transparent 2px, rgba(0,0,0,0.03) 2px, rgba(0,0,0,0.03) 4px)'
        }} />

        {/* AI Overlays */}
        {showAI && activeFindings.map((f, i) => {
          const isPending = f.status === 'Pending';
          const color = isPending ? '#EF4444' : '#10B981';
          const bgColor = isPending ? 'rgba(239,68,68,0.08)' : 'rgba(16,185,129,0.06)';

          return (
            <div
              key={f.id}
              className="absolute transition-all duration-500"
              style={{
                top: `${22 + (i * 14)}%`,
                left: `${18 + (i * 22)}%`,
                width: '108px',
                height: '72px',
              }}
            >
              {/* Box */}
              <div style={{
                position: 'absolute',
                inset: 0,
                border: `1.5px solid ${color}`,
                background: bgColor,
                borderRadius: '3px',
              }} />
              {/* Corner accents */}
              {[['top-0 left-0', 'border-t-2 border-l-2'], ['top-0 right-0', 'border-t-2 border-r-2'], ['bottom-0 left-0', 'border-b-2 border-l-2'], ['bottom-0 right-0', 'border-b-2 border-r-2']].map(([pos, borders], ci) => (
                <div key={ci} className={`absolute w-2.5 h-2.5 ${pos} ${borders}`} style={{ borderColor: color }} />
              ))}
              {/* Label */}
              <div
                className="absolute -top-6 left-0 flex items-center gap-1.5 px-2 py-0.5 rounded-t text-white"
                style={{ background: color, fontSize: '9px', fontWeight: 700, letterSpacing: '0.05em', whiteSpace: 'nowrap' }}
              >
                <span>T{f.toothNumber}</span>
                <span style={{ opacity: 0.75 }}></span>
                <span style={{ opacity: 0.85 }}>{Math.round(f.confidence * 100)}%</span>
              </div>
            </div>
          );
        })}

        {/* No overlay state */}
        {!showAI && (
          <div className="absolute inset-0 flex items-center justify-center pointer-events-none">
            <span className="text-white/15 text-[10px] font-mono uppercase tracking-[0.25em]">Overlay Disabled</span>
          </div>
        )}
      </div>

      {/* Footer info */}
      <div className="px-4 py-3 border-t border-slate-100 dark:border-slate-800 shrink-0">
        <div className="flex items-center justify-between">
          <div className="flex items-center gap-2">
            <div className="w-6 h-6 rounded-lg bg-primary/10 flex items-center justify-center">
              <svg className="w-3 h-3 text-primary" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M9.663 17h4.673M12 3v1m6.364 1.636l-.707.707M21 12h-1M4 12H3m3.343-5.657l-.707-.707m2.828 9.9a5 5 0 117.072 0l-.548.547A3.374 3.374 0 0014 18.469V19a2 2 0 11-4 0v-.531c0-.895-.356-1.754-.988-2.386l-.548-.547z"/>
              </svg>
            </div>
            <div>
              <p className="text-[10px] font-semibold text-slate-500 dark:text-slate-400 uppercase tracking-wider">AI Engine</p>
              <p className="text-[11px] font-medium text-slate-700 dark:text-slate-300 font-mono">v4.2.1</p>
            </div>
          </div>
          <div className="flex items-center gap-3">
            <div className="text-right">
              <p className="text-[10px] text-slate-400 uppercase tracking-wider">Detections</p>
              <p className="text-sm font-bold text-slate-700 dark:text-slate-200 font-mono">{activeFindings.length}</p>
            </div>
            <div className="w-px h-8 bg-slate-100 dark:bg-slate-800" />
            <div className="text-right">
              <p className="text-[10px] text-slate-400 uppercase tracking-wider">Pending</p>
              <p className="text-sm font-bold text-red-500 font-mono">{activeFindings.filter(f => f.status === 'Pending').length}</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};
